import React from "react";
import Navbar from "./Navbar";
import { BrowserRouter, Route } from "react-router-dom";
import Home from "./Home";

const App: React.SFC = () => {
	return (
		<BrowserRouter>
			<div className="App">
				<Navbar />
                <Route path="/" component={Home} /> 
			</div>
		</BrowserRouter>
	);
};

export default App;
